// Offers.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import Pagination from "./Pagination"; // Upewnij się, że ścieżka jest poprawna

const OffersTable = () => {
  const [offers, setOffers] = useState([]); // Oferty dla bieżącej strony
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  // Parametry paginacji – zakładamy, że API zwraca np. 21 ofert w sumie
  const [currentPage, setCurrentPage] = useState(1);
  const [totalPages, setTotalPages] = useState(1);
  const pageSize = 10; // Liczba ofert na stronę

  useEffect(() => {
    const fetchOffers = async () => {
      setLoading(true);
      try {
        // Wykonujemy zapytanie do API dla bieżącej strony
        const response = await axios.get("https://api-lockstep.berlin-opiekunki.pl/v1/offer/all", {
          params: { page: currentPage, pageSize }
        });
        // Zakładamy, że odpowiedź ma strukturę:
        // { meta: { all: totalCount, count: currentCount }, offers: [...] }
        const { meta, offers: fetchedOffers } = response.data;
        console.log("All offers for page", currentPage, ":", fetchedOffers);
        setOffers(fetchedOffers);
        // Obliczamy liczbę stron na podstawie meta.all
        setTotalPages(Math.ceil(meta.all / pageSize));
      } catch (err) {
        console.error("Błąd pobierania ofert:", err);
        setError("Błąd pobierania ofert");
      } finally {
        setLoading(false);
      }
    };

    fetchOffers();
  }, [currentPage]);

  // Funkcja zmieniająca stronę – zmiana currentPage spowoduje ponowne pobranie danych
  const handlePageChange = (page) => {
    setCurrentPage(page);
  };

  if (loading) return <div>Ładowanie ofert...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div style={{ padding: "20px", fontFamily: "Arial, sans-serif" }}>
      <h2 style={{ textAlign: "center" }}>Oferty Pracy</h2>
      <table style={{ width: "100%", borderCollapse: "collapse", marginTop: "20px" }}>
        <thead>
          <tr style={{ backgroundColor: "#f4f4f4" }}>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Name</th>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Tytuł</th>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Opis</th>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Miasto</th>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Kod</th>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Płeć</th>
            <th style={{ border: "1px solid #ddd", padding: "12px", textAlign: "left" }}>Data rozpoczęcia</th>
          </tr>
        </thead>
        <tbody>
          {offers.map((offer, index) => (
            <tr key={`${offer.name}-${index}`}>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>{offer.name}</td>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>{offer.title}</td>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>{offer.description}</td>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>{offer.city}</td>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>{offer.code}</td>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>{offer.sex}</td>
              <td style={{ border: "1px solid #ddd", padding: "12px" }}>
                {offer.startDate ? new Date(offer.startDate).toLocaleString() : "Brak daty"}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      {/* Komponent paginacji */}
      <Pagination
        pages={totalPages}
        currentPage={currentPage}
        route="offers" // lub inna nazwa ścieżki, która odpowiada Twojemu routowaniu
        routeParams={{}} // dodatkowe parametry jeśli są potrzebne
        maxPages={totalPages}
      />
    </div>
  );
};

export default OffersTable;
